import "./Education.scss";

export default function Education() {
  const data = [
    {
      id: 1,
      name: "Narayana e-techno School",
      year: "2016",
      title: "10th Standard ",
      CGPA: "CGPA: 8.3",
      course: "Course: SSC",
      icon: "assets/Logo-1.png",
    },
    {
      id: 2,
      name: "SRM University AP",
      year: "2018-2022",
      title: "B-TECH",
      CGPA: "CGPA: 8.0",
      course: "Course: CSE",
      icon: "assets/Logo-2.png",
      featured: true,
    },
    {
      id: 3,
      name: "Narayana Jr College",
      year: "2016-2018",
      title: "Intermediate",
      CGPA: "Percentage: 80%",
      course: "Course: MPC",
      icon: "assets/Logo-1.png",
    },
  ];

  return (
    <div className="education" id="Education">
      <h1>Education</h1>
      <div className="container">
        {data.map((d) => (
          <div className={d.featured ? "card featured" : "card"} key={d.id}>
            <h4>{d.title}</h4>
            <div className="top">
              <img className="icon" src={d.icon} alt="Institution Logo" />
            </div>
            <h3>{d.name}</h3>
            <p>{d.year}</p>
            <p>{d.CGPA}</p>
            <p>{d.course}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
